INSERT INTO `db_conabrul` (`id`, `rules`, `about`, `contacts`) VALUES
(1, '<p style="text-align: center;"><span style="color: #800000;"><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">1. ОБЩИЕ ПОЛОЖЕНИЯ</span></strong></span><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">1.1.</span>&nbsp;Зарегистрировавшись на данном проекте, пользователь</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">соглашается с данными правилами в полном объёме.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">Аккаунты пользователей данного проекта, которые</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">грубо нарушили правила данного проекта, восстановлению</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">на данном проекте не подлежат.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">Степень нарушений данных правил данного</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">проекта определяется исключительно администрацией</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">данного проекта.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">В случае игнорирования данных правил данного проекта</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">или их несоблюдения, игровой аккаунт</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">пользователя-нарушителя данных правил</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">данного проекта подлежит блокировке или,</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">в случае особо грубых нарушений, удалению.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">1.2.</span>&nbsp;Денежные средства пользователям-нарушителям данных правил<br />данного проекта при этом не возвращаются.<br /></span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">1.3.</span>&nbsp;Регистрируясь на данном проекте, пользователь данного</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">проекта подтверждает то, что ему исполнилось 18 лет.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">1.4.</span>&nbsp;Администрация данного проекта не несёт ответственности</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">за возможный ущерб, нанесённый пользователю данного</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">проекта в результате использования данного проекта.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">Администрация данного проекта не несёт ответственности</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">за возможное понижение заработка пользователей</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">данного проекта на данном проекте.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">При оплате каких-либо услуг на данном проекте,</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">а затем отказа от их использования, денежные средства</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">пользователям данного проекта не возвращаются.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">1.5.&nbsp;</span>Администрация данного проекта может вносить в правила</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">данного проекта изменения, в любой момент и по своему</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">личному усмотрению, не предупреждая об этом</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">пользователей данного проекта.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">Любое изменение в данных правилах данного проекта</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">начинает действовать сразу после внесения изменений</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">со стороны администрации данного проекта.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">Пользователи данного проекта понимают и соглашаются</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">при регистрации на данном проекте с тем,</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">что только они несут единоличную ответственность за</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">регулярный просмотр данных правил данного проекта.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">1.6.&nbsp;</span>Администрация данного проекта не несёт</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">ответственности за возможный взлом игровых аккаунтов</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">пользователей данного проекта.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">Для того, чтобы не позволить злоумышленникам проникать</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">в свои игровые аккаунты, пользователям данного проекта</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">необходимо использовать на данном проекте исключительно</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">уникальный, нигде ранее не указываемый пароль,</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">состоящий при этом из множества символов.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">1.7.&nbsp;</span>На данном проекте нет баллов и других ограничений на вывод.&nbsp;</span></strong><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">1.8.</span>&nbsp;Любые другие инструкции и положения, не вошедшие</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">в правила данного проекта, но опубликованные на данном</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">проекте в других разделах, являются</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">неотъемлемой частью правил данного проекта.&nbsp;</span></strong><br /><br /><br /><br /><br /><span style="color: #800000;"><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">2. ОБЯЗАННОСТИ ПРОЕКТА</span></strong></span><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">2.1.</span>&nbsp;Сохранять конфиденциальность информации</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">зарегистрированного пользователя данного проекта,</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">полученной от него при регистрации на данном проекте.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">2.2.</span>&nbsp;При возникновении технических проблем возобновить</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">работу данного проекта в течении 3-х суток.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">2.3.</span>&nbsp;Выплачивать денежные средства пользователям</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">данного проекта в течении 3-х суток,</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">с момента заказа ими выплаты.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">2.4.</span>&nbsp;Отвечать на письма, присланные в службу</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">технической поддержки в течении 24-х часов, при условии,</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">что пользователь данного проекта не является</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">нарушителем данных правил данного проекта и у него</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">действительно проблема, а не просто желание пообщаться</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">или желание решить свою проблему, не имеющую</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">отношения к данному проекту.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">В том случае, если на вопрос пользователя</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">данного проекта есть ответ на данном проекте,</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">ответ на вопрос от техподдержки&nbsp;</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">данного проекта не гарантируется.&nbsp;</span></strong><br /><br /><br /><br /><br /><span style="color: #800000;"><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">3. ОБЯЗАННОСТИ ПОЛЬЗОВАТЕЛЕЙ</span></strong></span><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">3.1.</span>&nbsp;При регистрации на данном проекте указывать</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">правдивую информацию во всех полях регистрационной формы.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">3.2.</span>&nbsp;Регулярно знакомиться с данными</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">правилами данного проекта.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">3.3.</span>&nbsp;Один пользователь данного проекта может иметь</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">на данном проекте только один игровой аккаунт.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">В случае обнаружения более одного игрового аккаунта</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">c использованием одного ай-пи адреса или с использованием</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">одного кошелька, все такие аккаунты подлежат</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">блокировке или удалению.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">3.4.</span>&nbsp;Не проводить попыток взлома данного проекта,</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">не использовать возможные ошибки на данном проекте.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">Не пытаться обмануть систему каким-либо образом.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">Не использовать различные скрипты, программы</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">и приложения для частого автообновления</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">страниц данного проекта.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">3.5.</span>&nbsp;Не выражать недовольство по поводу данного проекта</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">и его работы, не спорить с администрацией данного проекта,</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">не попрошайничать.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">3.6.</span>&nbsp;Не обвинять администрацию данного проекта, не угрожать</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">ей, не оказывать давление, не отправлять администрации</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">спам на почту и не обманывать администрацию.</span></strong><br /><br /><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;"><span style="color: #800000;">3.7.</span>&nbsp;Заходить в свой игровой аккаунт минимум</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">один раз в месяц.</span></strong><br /><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">Если у пользователя нет возможности заходить</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">в свой аккаунт минимум один раз в месяц,</span></strong><br /><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">ему нужно отказаться от регистрации на данном проекте.</span></strong><br /><br /><br /><br /><span style="color: #800000;"><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;">Последнее редактирование правил проекта 28.01.2016.</span></strong></span></p>', '<h3><strong><strong><strong>\r\n<p style="text-align: justify;">На сайт не выведен текст</p>\r\n</strong></strong></strong></h3>\r\n<h3><strong><strong><strong><strong><strong> </strong></strong></strong></strong></strong></h3>', '<p style="text-align: center;"><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #000000;">Если у Вас возникла какая-либо проблема, связанная </span></p>\r\n<p style="text-align: center;"><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #000000;">с нашим&nbsp;проектом, напишите нам на почту :</span></p>\r\n<p style="text-align: center;"><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #000000;">&nbsp;support@brave-knights.biz</span></p>\r\n<p style="text-align: center;"><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #000000;">Обязательно пишите нам с почты, которая &nbsp;является&nbsp;Вашим</span></p>\r\n<p style="text-align: center;"><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium; color: #000000;">логином на проекте.&nbsp;Если у Вас просто вопрос или что-то</span></p>\r\n<p style="text-align: center;"><span style="color: #000000;"><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium;">&nbsp;</span><span style="font-family: ''comic sans ms'', sans-serif; font-size: medium;">непонятно&nbsp;по нашему проекту, пожалуйста отправляйтесь </span></span></p>\r\n<p style="text-align: center;"><span style="color: #000000;"><span sty