(63, 32, 'Zirodin', 1454112967, 0, 'Добрый день я являюсь владельцем ютуб канала https://www.youtube.com/channel/UCGo-l8RvsnK5pJ1v5_PBWKg и могу записать обзор о вашей игре. Какие преференции меня ждут. за исключением реф отчислений'),
(64, 33, 'invar', 1454141436, 0, 'Привет Админ!\r\nВо-первых хочу выразить благодарность за отличную игру. Нр хотелось бы сделать несколько замечаний.\r\n1. Спасибо, что прислушался и изменил добычу рыцаря на 70 в час. Хотя по маркетингу должно быть 75 в час.\r\n2. Совсем непонятно ограничение казармы. Глупо сидеть и ждать 3 месяца, когда освободится место. Почему не сделать 15 мест бесплатно, а потом расширение ха деньги. Например за 100 рублей до 30, потом за 200 рублей до 60.\r\n'),
(65, 34, 'invar', 1454141820, 0, 'Извини не поместилось в предыдущее.\r\n3. И совсем плохо, что опыт дается фактически за клики. Можно купить одного рабочего и тупо кликать каждые 10 минут на сбор ресурсов, И ты будешь самый опытный. Я бы увязал опыт еще с количеством собранных ресурсов, например 1 единица опыта за сбор 10 ресурсов (это надо считать). Это стимулировало бы к покупкам героев\r\nНо это мои предложения. А вообще проект отличный. Спасибо'),
(66, 35, 'invar', 1454142085, 0, 'И совсем уже наверное задолбал. Но на странице вывода средств фраза &quot;Вы вели ... из доступных ...&quot; Люди воспринимают это что нельзя вывести больше чем ввел. Надеюсь это не так'),
