CREATE TABLE IF NOT EXISTS `m_lotery` (
  `id` int(255) NOT NULL,
  `user` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `stavka` float(20,2) DEFAULT NULL,
  `stevka_pay` float(20,2) DEFAULT NULL,
