  `nomd5` varchar(2000) CHARACTER SET utf8 DEFAULT NULL,
  `md5` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `a_1` varchar(12) CHARACTER SET utf8 DEFAULT NULL,
  `a_2` varchar(12) CHARACTER SET utf8 DEFAULT NULL,
  `a_3` varchar(12) CHARACTER SET utf8 DEFAULT NULL,
  `a_4` varchar(12) CHARACTER SET utf8 DEFAULT NULL,
  `a_5` varchar(12) CHARACTER SET utf8 DEFAULT NULL,
  `status` int(3) DEFAULT NULL,
  `h1` varchar(1) CHARACTER SET utf8 DEFAULT NULL,
  `h2` varchar(1) CHARACTER SET utf8 DEFAULT NULL,
  `h3` varchar(1) CHARACTER SET utf8 DEFAULT NULL,
  `h4` varchar(1) CHARACTER SET utf8 DEFAULT NULL,
  `h5` varchar(1) CHARACTER SET utf8 DEFAULT NULL,
  `vid_prise` varchar(20) DEFAULT NULL,
  `sum_prise` varchar(200) DEFAULT NULL,
  `status_prise` int(1) DEFAULT NULL,
  `date` int(255) DEFAULT NULL,
  `setoc` varchar(50) DEFAULT NULL
) ENGINE=InnoDB AUTO_INCREMENT=145 DEFAULT CHARSET=cp1251;

